import React,{useState} from "react";
import Result from "./Result";

const Search=()=>{
    const[img,setImg]=useState("")
    const inputEvent=(e)=>{
        const data=e.target.value
        setImg(data)

    }
    return(
        <>
          <input type="text" placeholder="search"
          value={img} onChange={inputEvent}/>
          <Result name={img}/>
        </>
        
    )
}
export default Search
